import './userTile.css';
import more from './more-horizontal.svg';
import defaultUser from './default-user.svg';

const UserTile = () => {
  return (
    <>
      <div className='userTile'>
        <div className='user'>
          {/* shows user's image */}
          <img src={defaultUser} alt='user image' id='userImage' />
        </div>
        <div className='icons'>
          <img src={more} alt='more' className='icon' />
        </div>
      </div>
    </>
  );
}

export default UserTile;
